DROP TABLE IF EXISTS "api_assetdailychecksmodelhistory" CASCADE;
CREATE TABLE "api_assetdailychecksmodelhistory" (
  "daily_check_history_id" int NOT NULL GENERATED BY DEFAULT AS IDENTITY,
  "custom_id" varchar(100) NOT NULL,
  "operable" boolean NOT NULL,
  "mileage" double precision DEFAULT NULL,
  "hours" double precision DEFAULT NULL,
  "is_tagout" boolean NOT NULL,
  "date" timestamp(6) NOT NULL,
  "tires" boolean DEFAULT NULL,
  "wheels" boolean DEFAULT NULL,
  "horn" boolean DEFAULT NULL,
  "fuel" int DEFAULT NULL,
  "mirrors" boolean DEFAULT NULL,
  "glass" boolean DEFAULT NULL,
  "overhead_guard" boolean DEFAULT NULL,
  "steps" boolean DEFAULT NULL,
  "forks" boolean DEFAULT NULL,
  "operator_cab" boolean DEFAULT NULL,
  "cosmetic_damage" boolean DEFAULT NULL,
  "brakes" boolean DEFAULT NULL,
  "steering" boolean DEFAULT NULL,
  "attachments" boolean DEFAULT NULL,
  "mud_flaps" boolean DEFAULT NULL,
  "electrical_connectors" boolean DEFAULT NULL,
  "air_pressure" boolean DEFAULT NULL,
  "boom_extensions" boolean DEFAULT NULL,
  "spreader_functions" boolean DEFAULT NULL,
  "headlights" boolean DEFAULT NULL,
  "backup_lights" boolean DEFAULT NULL,
  "trailer_light_cord" boolean DEFAULT NULL,
  "oil" boolean DEFAULT NULL,
  "transmission_fluid" boolean DEFAULT NULL,
  "steering_fluid" boolean DEFAULT NULL,
  "hydraulic_fluid" boolean DEFAULT NULL,
  "brake_fluid" boolean DEFAULT NULL,
  "fire_extinguisher" boolean DEFAULT NULL,
  "hydraulic_hoses" boolean DEFAULT NULL,
  "trailer_air_lines" boolean DEFAULT NULL,
  "other_leaks" boolean DEFAULT NULL,
  "daily_check_id" int DEFAULT NULL,
  "location_id" int DEFAULT NULL,
  "modified_by_id" int DEFAULT NULL,
  PRIMARY KEY ("daily_check_history_id"),
  CONSTRAINT "api_assetdailychecks_daily_check_id_668316ed_fk_api_asset" FOREIGN KEY ("daily_check_id") REFERENCES "api_assetdailychecksmodel" ("daily_check_id"),
  CONSTRAINT "api_assetdailychecks_location_id_21106c94_fk_api_locat" FOREIGN KEY ("location_id") REFERENCES "api_locationmodel" ("location_id"),
  CONSTRAINT "api_assetdailychecks_modified_by_id_107f412c_fk_api_detai" FOREIGN KEY ("modified_by_id") REFERENCES "api_detaileduser" ("detailed_user_id")
);

CREATE INDEX "api_assetdailychecks_daily_check_id_668316ed_fk_api_asset" ON "api_assetdailychecksmodelhistory" ("daily_check_id");
CREATE INDEX "api_assetdailychecks_location_id_21106c94_fk_api_locat" ON "api_assetdailychecksmodelhistory" ("location_id");
